    false,nt"url": null,nt"notes": "This report summarizes the results of a
    study to determine the fundamental structure of a continental margin near the Shumagin
    and Sanak Islands. The primary objectives of the study were to: study sedimentary
    structures, soft-sediment deformation, and lithographic variation in hopes of revealing
    the nature and geometry of the depositional basin; and detail the post-consolidational
    tectonic deformation and plutonism. A description of the study area is included.
    A discussion of the preliminary results is also provided. A study area map is attached.",nt"license_title":
